Question: Mori Set and Kail were asked to bring some fruits. Mori Set brought 5 apples and 8 oranges, while Kail brought twice as many apples as Mori Set and half as many oranges. How many fruits do they have in total?

Answer: Mori Set brought 5 apples + 8 oranges = 13 fruits. Kail brought 2 * 5 apples (which is 10 apples) + 8 oranges / 2 (which is 4 oranges) = 14 fruits. Therefore, they have 13 + 14 = 27 fruits in total.

The total number of fruits they have is \\boxed{27}
